	<NavContainer>
		<NavLink>Video</NavLink>
		<NavLink>Letter</NavLink>
		<NavLink>Resume</NavLink>
		<NavLink>Portfolio</NavLink>
		<NavLink>Contact</NavLink>
	</NavContainer>
);

export default Navigation;
